import React from 'react';

const ItemList = props => {
  return (
    <div className='col s6 m6 l4 '>
      <div class='card'>
        <div class='card-image waves-effect waves-block waves-light'>
          <img class='activator' src='images/office.jpg' />
        </div>
        <div class='card-content'>
          <span class='card-title activator grey-text text-darken-4'>
            Card Title<i class='material-icons right'>more_vert</i>
          </span>
          <p>
            <a href='#'>This is a link</a>
          </p>
        </div>
        <div class='card-reveal'>
          <span class='card-title grey-text text-darken-4'>
            Card Title<i class='material-icons right'>close</i>
          </span>
          <p>
            Here is some more information about this product that is only
            revealed once clicked on.
          </p>
        </div>
      </div>
      {/* <div className='card hoverable'>
        <div
          className='card-content'
          style={{ cursor: 'pointer' }}
          onClick={props.add}
          id={props.item.Name}
        >
          <span className='right' style={{ top: 0 }}>
            {props.item.Avail}
          </span>
          <span className='card-title' onClick={props.add} id={props.item.Name}>
            {props.item.Name}
          </span>
          <div className='right'>Price : {props.item.Price}</div>
        </div>
      </div> */}
    </div>
  );
};
export default ItemList;
